INSERT INTO `section` VALUES ('53', '42', 'SECTION C: INTRODUCTION AND CONSENT', 'Assalamo Alaikum. \nMy name is (Name of Interviewer) and I am working with Centre of Excellence in Women and Child Health, Aga Khan University Karachi. In collaboration with National Ministry of Health Services, Regulation and Coordination Government of Pakistan and Provincial Health Departments of Balochistan, Punjab and Sindh, we are conducting a project on Maternal, newborn and child health in selected districts of Pakistan. As part of the project, we are collecting information on the status of health of population in these selected districts. The Information we are collecting relates to knowledge, attitudes and practices on maternal, newborn and child health including morbidity and mortality. This information will be used to design strategies in improving MNCH services by government and other healthcare providers in your area. The whole process of this interview may take approximately one hour. We would very much appreciate your participation in this survey. All of the answers you provide will be confidential. Your participation in the survey is voluntary. If you do not want to provide information to a specific question or a section, please let me know. You may also withdraw from this interview at any time. ', 'SECTION C: INTRODUCTION AND CONSENT', 'Assalamo Alaikum. \nMy name is (Name of Interviewer) and I am working with Centre of Excellence in Women and Child Health, Aga Khan University Karachi. In collaboration with National Ministry of Health Services, Regulation and Coordination Government of Pakistan and Provincial Health Departments of Balochistan, Punjab and Sindh, we are conducting a project on Maternal, newborn and child health in selected districts of Pakistan. As part of the project, we are collecting information on the status of health of population in these selected districts. The Information we are collecting relates to knowledge, attitudes and practices on maternal, newborn and child health including morbidity and mortality. This information will be used to design strategies in improving MNCH services by government and other healthcare providers in your area. The whole process of this interview may take approximately one hour. We would very much appreciate your participation in this survey. All of the answers you provide will be confidential. Your participation in the survey is voluntary. If you do not want to provide information to a specific question or a section, please let me know. You may also withdraw from this interview at any time. ', null, null, null, null, null, null, null, null, 'C', 'Ongoing', 'introduction_consent', '26', '14', '');
INSERT INTO `section` VALUES ('54', '42', 'SECTION D: HOUSEHOLD MEMBERS INFORMATION', 'Now I would like to ask you questions on household member information who live with you in this house and share the same kitchen. This information will be used to assess the health care needs, and services available to you and your household members in the area.', 'SECTION D: HOUSEHOLD MEMBERS INFORMATION', 'Now I would like to ask you questions on household member information who live with you in this house and share the same kitchen. This information will be used to assess the health care needs, and services available to you and your household members in the area.', null, null, null, null, null, null, null, null, 'D', 'Ongoing', 'household_member_information', '26', '14', '');
INSERT INTO `section` VALUES ('55', '42', 'SECTION E: REPRODUCTIVE HEALTH', '(Complete this table for all married women aged 15-49 years in the household) \nDefinition of Live Birth: Live birth refers to the complete expulsion or extraction from its mother of a product of conception, irrespective of the duration of the pregnancy, which, after such separation, breathes or shows any other evidence of life - e.g. beating of the heart, pulsation of the umbilical cord or definite movement of voluntary muscles - whether or not the umbilical cord has been cut or the placenta is attached. Each product of such a birth is considered born alive.', 'SECTION E: REPRODUCTIVE HEALTH', '(Complete this table for all married women aged 15-49 years in the household) \nDefinition of Live Birth: Live birth refers to the complete expulsion or extraction from its mother of a product of conception, irrespective of the duration of the pregnancy, which, after such separation, breathes or shows any other evidence of life - e.g. beating of the heart, pulsation of the umbilical cord or definite movement of voluntary muscles - whether or not the umbilical cord has been cut or the placenta is attached. Each product of such a birth is considered born alive.', null, null, null, null, null, null, null, null, 'E', 'Ongoing', 'reproductive_health', '26', '14', '');
INSERT INTO `section` VALUES ('56', '42', 'SECTION F: ANTENATAL CARE', 'Now I am going to collect information related to your last pregnancy, childbirth, and your health-seeking behavior. ', 'SECTION F: ANTENATAL CARE', 'Now I am going to collect information related to your last pregnancy, childbirth, and your health-seeking behavior. ', null, null, null, null, null, null, null, null, 'F', 'Ongoing', 'antenatal_care', '26', '14', '');
INSERT INTO `section` VALUES ('57', '42', 'SECTION G: DELIVERY PREPAREDNESS AND EXPERIENCE', 'Now I would like to ask you some questions about your last (most recent) delivery history and the preparedness for delivery. ', 'SECTION G: DELIVERY PREPAREDNESS AND EXPERIENCE', 'Now I would like to ask you some questions about your last (most recent) delivery history and the preparedness for delivery. ', null, null, null, null, null, null, null, null, 'G', 'Ongoing', 'delivery_preparedness', '26', '14', '');
