INSERT INTO `section_detail` VALUES ('3941', '61', '42', 'J117', 'Radio', 'R', '0', 'Has (name) ever received a Pneumococcal Conjugate vaccination – that is, an injection to prevent (him/her) from getting pneumococcal disease, including ear infections and meningitis caused by pneumococcus?  	Probe by indicating that Pneumococcal Conjugate vaccination is sometimes given at the same time as the Pentavalent vaccination.', ')نمونیاکی ویکسین لگی ہے، جوایک انجکشن ران Pneumococcalکیا (نام) کوکبھی( میں لگایا جاتا ہے جس سے (بچہ/بچی)نمونیہ، کان کا انفیکشن اور گردن توڑ بخار  کی بیماریوں سے محفوظ رہتا ہے؟ 	نشاندہی کرتے ہوئےاس بات کی تحقیق کریں کہ بعض اوقات پولیو کے قطروں کے ساتھ  ہی نمونیہ کی  ویکسین بھی دی جاتی ہے', 'ڇا (نالو) کي ڪڏھن به ران ۾ ٽڪو لڳو آھي جيڪو ٻار کي نمونيا جي بيماري کان بچاءُ ڪندو آھي؟ ', '', '', null, '', '', '', 'Radio', null, '', '', '', '', null, '26', '14', '', '', '', '', '');
