INSERT INTO `section_detail` VALUES ('3945', '61', '42', 'J116', 'Input-Numeric', 'EN', '0', 'How many times was the Pentavalent vaccine received?', 'پینٹا ویلینٹ ویکسین کتنی بار لگی تھی؟', ' ڪيترا دفعه (نالو) کي ران ڌڏ ۾ ٽڪو لڳو آھي جيڪو ٻار کي جھٽڪن، ڪاري کنگھ، خناق، ھيپاٽائيٽس ۽ ھيموفيلس انفلوئينزا جي بيمارين کان بچاءُ ڪندو آھي؟', '', '', null, '', '', '', 'Input-Numeric', null, '', '', '', '', null, '26', '14', 'Y', 'varchar', '50', '0', '');
INSERT INTO `section_detail` VALUES ('3946', '61', '42', 'J115', 'Radio', 'R', '0', 'Has (name) ever received a Pentavalent vaccination – that is, an injection in the thigh to prevent (him/her) from getting tetanus, whooping cough, diphtheria, Hepatitis B disease, and Haemophilus influenzae type b?  	Probe by indicating that Pentavalent vaccination is sometimes given at the same time as the Polio drops.', ') لگا ہے یہ ایک انجکشن  ہےجو ران  میں لگایا Pentavalentکیا(نام)کوکبھی( جاتا ہے جو بچہ/بچی کو تشنج،کالی کھانسی، خناق،ہیپا ٹائٹس بی کی بیماری ،اور ہیموفائلس  انفلوئنزا بی سےمحفوظ رکھتا ہے؟ 	نشاندہی کرتے ہوئے اس بات کی تحقیق کریں کہ بعض اوقات پولیو کے قطروں کے ساتھ  ہی پینٹا ویلینٹ ویکسین بھی دی جاتی ہے۔', 'ڇا (نالو) کي ڪڏھن به ران ڌڏ ۾ ٽڪو لڳو آھي جيڪو ٻار کي جھٽڪن، ڪاري کنگھ، خناق، ھيپاٽائيٽس ۽ ھيموفيلس انفلوئينزا جي بيمارين کان بچاءُ ڪندو آھي؟ (ڪڏھن ڪڏھن پوليو جي ڦڙن سان گڏ لڳايو ويندو آھي)', '', '', null, '', '', '', 'Radio', null, '', '', '', '', null, '26', '14', '', '', '', '', '');
