INSERT INTO `section_detail` VALUES ('3990', '61', '42', 'J107', 'Title', 'T', '0', 'Go back to J104 and probe for these vaccinations.  	Record ‘66’ in the corresponding day column for each vaccine received.  	For vaccinations not received record ‘00’.  	When finished, go to End of module.', 'پر جائیں اور ان حفاظتی ٹیکوں کی جانچ کریں لگنے والی ہر ویکسین کے لئے اس دن کے کالم میں\'66\' ریکارڈ کریں۔ جو ویکسینز نہیں لگیں ان کے لئے\'00\' ریکارڈ J104واپس سوال نمبر  کریں۔جب مکمل کر لیں، تو ماڈیول کے اختتام پر جائیں', 'J104 ڏانھن واپس وڃو ۽ انھن ويڪسينس جي باري ۾ پڇو.  لکو 66 ڏينھن واري ڪالم جڏھن ھرھڪ ويڪسين حاصل ڪئي. جيڪڏھن نه حاصل ڪئي آھي ته 00 لکو سيڪشن جي آخر تي وڃو', '', '', null, '', 'J122', '', 'Title', null, '', '', '', '', null, '26', '14', '', '', '', '', '');
